import React from 'react';
import PropTypes from 'prop-types';

Ablum.propTypes = {
  album: PropTypes.object,
};

Ablum.defaultProps = {
  album: {}
}

function Ablum(props) {
  const { album } = props
  return (
    <div>
      <div>
        <img src={album.img} alt=""/>
        <p>{album.name}</p>
      </div>
    </div>
  );
}

export default Ablum;
